def get_distance(point1,point2):
  point_list1=point1.split()
  point_list2=point2.split()
  x1=int(point_list1[0])
  y1=int(point_list1[1])
  x2=int(point_list2[0])
  y2=int(point_list2[1])

  ans=((x1-x2)**2+(y1-y2)**2)**0.5
  return(ans)

get_distance(point1,point2)
